import React from 'react';
import './App.css';
import styled from 'styled-components';


function App() {
  return (
    <div className="App">
      Hello
    </div>
  );
}

export default App;

const StyledBtn = styled.button`
  border: none;
  background-color: #fb3f78;
  padding: 10px 20px;
  border-radius: 5px;
  color: sandybrown;
`
